import React from "react";
import { useHistory } from "react-router-dom";
import '../../styles.css';
import { createBrowserHistory as history} from 'history';
import { Button } from 'react-bootstrap';

export default function landing() {

  return (
    <div>
    <h2>HOME PAGE</h2>
      <button type="submit" className="btn btn-primary w-30 theme-btn mx-auto">
        Log In / Sign Up
      </button>
      <img src="landing_page.jpg" width='1450' height='700'></img>


    <form>
    <Button variant="btn btn-success" onClick={() => history.push('/Login')}>Click button to view products</Button>
    </form>

    </div>
  );
}
